println!("{}", "Underlined text".underlined();
println!("{}", "Negative text".negative(); As you see in the above example you could call attributes methods on a string. How is this possible you might ask..? Well, the trait Styling , who you need to include, is implemented for &'static str . When calling a method on any string crossterm transforms will transform it into a StyledObject who you could use in your write statements. More examples could be found at this link .

