Print a rectangle colored with magenta and use both direct execution and lazy execution. rectangle with command functions use crossterm::{ExecutableCommand, QueueableCommand, Color, PrintStyledFont, Colorize};
use std::io::stdout(); let mut stdout = stdout(); stdout = stdout.execute(Clear(ClearType::All)); for y in 0..40 { for x in 0..150 { if (y == 0 || y == 40 - 1) || (x == 0 || x == 150 - 1) { stdout = stdout .queue(Goto(x,y)) .queue(PrintStyledFont( "█".magenta())); } } stdout.flush();
} rectangle with the macros use crossterm::{execute, queue, Color, PrintStyledFont, Colorize};
use std::io::stdout(); let mut stdout = stdout(); execute!(stdout, Clear(ClearType::All)); for y in 0..40 { for x in 0..150 { if (y == 0 || y == 40 - 1) || (x == 0 || x == 150 - 1) { queue!(stdout, Goto(x,y), PrintStyledFont( "█".magenta())); } } stdout.flush();
}
